import React, { Component } from 'react';

class Home extends Component {
    constructor(props){
        super(props);
        this.user = props.userName;
    }

    renderName = () => {
        if (this.user == null) {
            return;
        }
        return `Welcome {this.user}`;
    }
    render() {
        return (
            <div className="App">
                <h1>Project Home</h1>
                <h2>{this.renderName}</h2>
            </div>
        )
    }
}

export default Home;
